class Solution {
    func canMakeSubsequence(_ str1: String, _ str2: String) -> Bool {
        let s1 = Array(str1)
        let s2 = Array(str2)
        var dp = Array(repeating: Array(repeating: false, count: s2.count + 1), count: s1.count + 1)

        for i in 0...s1.count {
            dp[i][0] = true
        }

        for i in 1...s1.count {
            for j in 1...s2.count {
                if s1[i-1] == s2[j-1] {
                    dp[i][j] = dp[i-1][j-1]
                } else if (Int(s1[i-1].asciiValue!) + 1 - Int(s2[j-1].asciiValue!)) % 26 == 0 {
                    dp[i][j] = dp[i-1][j-1]
                }
                dp[i][j] = dp[i][j] || dp[i-1][j]
            }
        }

        return dp[s1.count][s2.count]
    }
}
